import React from 'react';
import {
  Container,
  Row,
  Col,
  Form,
  Button,
} from 'react-bootstrap';
import ServiceCard from '../components/ServiceCard';
import { useDispatch, useSelector } from 'react-redux';
import {
  setNameFilter,
  setMinPriceFilter,
  setMaxPriceFilter,
  setFromDateFilter,
  setToDateFilter,
  resetFilters,
} from '../features/filters/filterSlice';

const ServicesListPage: React.FC = () => {
  // Get filters from Redux
  const filters = useSelector((state: any) => state.filters);
  const dispatch = useDispatch();

  // Hardcoded data for the two specific service cards
  const services = [
    {
      id: 1,
      title: "Заемные средства",
      subtitle: "Формат работы: Бухгалтерский учет",
      description: "Сфера деятельности: Коммерческая",
      backgroundImage: "/images/service1.jpg", // Replace with actual path or URL
    },
    {
      id: 2,
      title: "Основные средства",
      subtitle: "Формат работы: Аудит",
      description: "Сфера деятельности: Промышленность",
      backgroundImage: "/images/service2.jpg", // Replace with actual path or URL
    },
  ];

  return (
    <Container className="mt-5">
      <h2>Список услуг</h2>

      {/* Filters (still visible but not currently used) */}
      <Form className="mb-4 p-3 border rounded bg-light">
        <Row className="gy-3">
          <Col xs={12} md={3}>
            <Form.Group controlId="formName">
              <Form.Label>Фильтр по имени</Form.Label>
              <Form.Control
                type="text"
                value={filters.name}
                onChange={(e) => dispatch(setNameFilter(e.target.value))}
              />
            </Form.Group>
          </Col>
          <Col xs={12} md={2}>
            <Form.Group controlId="formMinPrice">
              <Form.Label>Мин. цена</Form.Label>
              <Form.Control
                type="number"
                value={filters.minPrice}
                onChange={(e) =>
                  dispatch(setMinPriceFilter(Number(e.target.value)))
                }
              />
            </Form.Group>
          </Col>
          <Col xs={12} md={2}>
            <Form.Group controlId="formMaxPrice">
              <Form.Label>Макс. цена</Form.Label>
              <Form.Control
                type="number"
                value={filters.maxPrice}
                onChange={(e) =>
                  dispatch(setMaxPriceFilter(Number(e.target.value)))
                }
              />
            </Form.Group>
          </Col>
          <Col xs={12} md={2}>
            <Form.Group controlId="formFromDate">
              <Form.Label>С даты</Form.Label>
              <Form.Control
                type="date"
                value={filters.fromDate}
                onChange={(e) => dispatch(setFromDateFilter(e.target.value))}
              />
            </Form.Group>
          </Col>
          <Col xs={12} md={2}>
            <Form.Group controlId="formToDate">
              <Form.Label>По дату</Form.Label>
              <Form.Control
                type="date"
                value={filters.toDate}
                onChange={(e) => dispatch(setToDateFilter(e.target.value))}
              />
            </Form.Group>
          </Col>
          <Col xs={12} md={1}>
            <Button variant="secondary" onClick={() => dispatch(resetFilters())} className="w-100">
              Сброс
            </Button>
          </Col>
        </Row>
      </Form>

      {/* Cards - Display only the 2 hardcoded ones */}
      <Row xs={1} sm={2} md={2} className="g-4">
        {services.map((service) => (
          <Col key={service.id}>
            <ServiceCard {...service} />
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default ServicesListPage;
